const Header = () => (
  <>
    <Link href="/">
      <a className="logo">WYC</a>
    </Link>
    <Link href="/">
      <a className="navlink">Home</a>
    </Link>
    <Link href="/about">
      <a className="navlink">About</a>
    </Link>
    <style jsx>
      {`
        .logo {
          display: block;
        }

        .navlink {
          text-decoration: none;
          font-family: "Arial";
          margin-right: 15px;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
